import React,{useState,useEffect} from 'react';
import ""

function navBar(){
  return (
    <>
        <nav className = "navBar">
        
        <img src="../Images/Queue_Logo.png" alt="Icon" className="icon"/>
        <img src="../Images/menu-icon.png" alt="Icon" classNameName="menu-icon"/>
        <ul className="nav-menu">
            <li>Home</li>
            <li>Membership</li>
            <li>Booking</li>
            <li>Events</li>
            <li>Forum</li>
            <li>Resources</li>
            <li>Gallery</li>
            
        </ul>
        </nav>
    </>
  );
}

export default navBar;
